import React from 'react'
import Img1 from '../Images/doggy1.png'

function Products() {
  return (
    <div className="box" >
      <div className="product-card">
        <img src={Img1} alt="" className='product-img' />
        <h3></h3>
      </div>
    </div>
  )
}

export default Products
